import React, { Component } from "react";
import { AppBar } from "@material-ui/core";

class Header extends Component {
  state = {
    headerShow: false
  };
  render() {
    return (
      <AppBar
        position="fixed"
        style={{
          backgroundColor: this.state.headerShow ? "#2f2f2f" : "transparent",
          boxShadow: "none",
          padding: "10px 0px"
        }}
      ></AppBar>
    );
  }
}

export default Header;
